import React from "react";
import BrandImg from "../images/brand.png";

function Brand() {
    return (
        <div className="brand">
            <span>
                <a href="/" >
                    <img src={BrandImg} alt="Transfy image" />
                </a>
            </span>
            {/* Transfy */}
        </div>
    );
}

export default Brand;
